window.bookSummaryJSON = "<p><b>Beers. Oktoberfest. The Apocalypse.</b></p> <p>Leading astrophysicist Liam Jackson is participating in a scientist exchange program in Germany when a curveball of universal proportions is thrown at him. Planes fall from the sky, cars explode, and strange particles rain down from the heavens as monsters appear out of thin air.</p> <p>The laws of physics have changed in the world. The fundamental forces of the universe are behaving differently, and Liam needs to understand them if he wants to survive.</p> <p>Physics of the Apocalypse is a LitRPG series that combines the wonders of the cosmos with magic and science. Find out what base-building can look like in a medieval castle, how 3D printing can be used to create magic items, and how spacetime, nuclear, and quantum physics are combined with spellcasting.</p>"; 
